import React from "react";
import { NavLink as RRNavLink } from "react-router-dom";
// import "./styles.css";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";

const NavBar = () => {
  return (
    <div>
      <Nav className="Navbar">
        <NavItem className= "navletters">
          <NavLink tag={RRNavLink} to="/">
            Home
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink tag={RRNavLink} to="/journal">
            Journal
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink tag={RRNavLink} to="/stats">
            Stats
          </NavLink>
        </NavItem>
      </Nav>
    </div>
  );
};

export default NavBar;
